    >
        <Toolbar>
            <IconButton
                edge="start"
                color="inherit"
                onClick={props.handleCountryClose}
                aria-label="close"
            >
                <CloseIcon />
            </IconButton>
        </Toolbar>
    </Dialog>

    )

}
